export default (state = initialState, action) => {
  switch (action.type) {
      case GET_LIST_CINEMA_REDUX: {
        return {...state,listCinema:action.data}
      }
      case GET_LIST_DETAIL_FILMS_REDUX:{
        return {...state,listDetailCinema:action.data}

      }
   

  default:  return { ...state}
  }
}
